import React, { useState } from "react";
import "../cssFile/NavBar.css";
import NavBarList from "./NavBarList";

export default function NavBar() {
  const [ShowHide, setShowHide] = useState(false);

  function OpenBar() {
    setShowHide(!ShowHide);
    console.log(ShowHide)
  }

  return (
    <div>
      <img onClick={OpenBar} src="https://cdn2.iconfinder.com/data/icons/e-commerce-line-10-1/1024/menu10-128.png" />
      <NavBarList showOrHide={ShowHide} />
      <img
        id="cartButton"
        src="https://cdn2.iconfinder.com/data/icons/picons-basic-2/57/basic2-011_shopping_cart-256.png"
      />
    </div>
  );
}
